async function updateAvatarApi(file, userId) {
    const formData = new FormData();
    formData.append("file", file);
    formData.append("userId", userId);
    const res = await fetch("/api/profile/avatar", {
        method: "POST",
        body: formData
    });
    const data = await res.json();
    return data;
}
